import photo from "../assets/photo.png";
import "./css/main.css";

const Main = () => {
  return (
    <main className="mm">
      <div className="text">
        <h1>Emoção, diversão, <br></br> Parque Umbara.</h1>
        <h3>O destino perfeito para o seu próximo passeio!</h3>
      </div>
      <div className="img"><img src={photo} alt="" /></div>
    </main>
  );
};

export default Main;
